import React from "react";
import styled from "styled-components";

const StyledLocal = styled.div`
  border: 1px solid black;
  border-radius: 6px;
  width: 30%;
  margin: 0 1% 2%;
  height: 300px;
  overflow: hidden;

  & img {
    width: 100%;
    height: 50%;
    object-fit: cover;
  }

  & div {
    padding: 20px;
  }
`;

export default function Local({ props }) {
  return (
    <StyledLocal>
      <img src={props.img} alt="Local" />
      <div>
        <h3>{props.name}</h3>
      </div>
    </StyledLocal>
  );
}
